contracts/InfluencerToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract InfluencerToken is ERC20, Ownable {
    uint256 public immutable maxSupply;
    string public imageUrl;
    uint256 public createdAt;

    event ImageUrlUpdated(string newImageUrl);
    event TokensBurned(address indexed from, uint256 amount);
    event TokensMinted(address indexed to, uint256 amount);

    constructor(
        string memory name,
        string memory symbol,
        uint256 initialSupply,
        address initialOwner
    ) ERC20(name, symbol) Ownable(initialOwner) {
        maxSupply = initialSupply;
        createdAt = block.timestamp;
        _mint(initialOwner, initialSupply);
    }

    function setImageUrl(string memory _imageUrl) public onlyOwner {
        imageUrl = _imageUrl;
        emit ImageUrlUpdated(_imageUrl);
    }

    function mint(address to, uint256 amount) public onlyOwner {
        require(totalSupply() + amount <= maxSupply, "Exceeds max supply");
        _mint(to, amount);
        emit TokensMinted(to, amount);
    }

    function burn(uint256 amount) public {
        _burn(msg.sender, amount);
        emit TokensBurned(msg.sender, amount);
    }

    function burnFrom(address from, uint256 amount) public {
        uint256 currentAllowance = allowance(from, msg.sender);
        require(currentAllowance >= amount, "Burn amount exceeds allowance");
        _approve(from, msg.sender, currentAllowance - amount);
        _burn(from, amount);
        emit TokensBurned(from, amount);
    }

    function getTokenInfo() public view returns (
        string memory _name,
        string memory _symbol,
        uint256 _totalSupply,
        uint256 _maxSupply,
        string memory _imageUrl,
        uint256 _createdAt,
        address _owner
    ) {
        return (
            name(),
            symbol(),
            totalSupply(),
            maxSupply,
            imageUrl,
            createdAt,
            owner()
        );
    }
}

