    mapping(address => TokenInfo) public tokenInfo;
    mapping(address => uint256) public tokenLiquidity;

    struct TokenInfo {
        string name;
        string symbol;
        string imageUrl;
        uint256 totalSupply;
        address owner;
        uint256 chzLiquidity;
        uint256 createdAt;
    }

    event TokenCreated(
        address indexed tokenAddress,
        address indexed owner,
        string name,
        string symbol,
        uint256 totalSupply,
        uint256 chzLiquidity
    );

    event TokenSwapped(
        address indexed user,
        address indexed tokenAddress,
        uint256 chzAmount,
        uint256 tokenAmount,
        bool isChzToToken
    );

    modifier onlyValidToken(address tokenAddress) {
        require(tokenInfo[tokenAddress].owner != address(0), "Token not found");
        _;
    }

    function createToken(
        string memory name,
        string memory symbol,
        string memory imageUrl,
        uint256 initialSupply,
        address owner
    ) public payable returns (address) {
        require(msg.value > 0, "CHZ liquidity required");

        InfluencerToken newToken = new InfluencerToken(
            name,
            symbol,
            initialSupply,
            owner
        );

        address tokenAddress = address(newToken);
        deployedTokens.push(tokenAddress);

        tokenInfo[tokenAddress] = TokenInfo({
            name: name,
            symbol: symbol,
            imageUrl: imageUrl,
            totalSupply: initialSupply,
            owner: owner,
            chzLiquidity: msg.value,
            createdAt: block.timestamp
        });

        tokenLiquidity[tokenAddress] = msg.value;

        emit TokenCreated(tokenAddress, owner, name, symbol, initialSupply, msg.value);
        return tokenAddress;
    }

    function swapChzToToken(address tokenAddress) public payable onlyValidToken(tokenAddress) {
        require(msg.value > 0, "CHZ amount required");

        uint256 tokenAmount = getTokenAmountForChz(tokenAddress, msg.value);
        require(tokenAmount > 0, "Invalid swap amount");

        InfluencerToken token = InfluencerToken(tokenAddress);
        require(token.balanceOf(address(this)) >= tokenAmount, "Insufficient token liquidity");

        tokenLiquidity[tokenAddress] += msg.value;
        token.transfer(msg.sender, tokenAmount);

        emit TokenSwapped(msg.sender, tokenAddress, msg.value, tokenAmount, true);
    }

    function swapTokenToChz(address tokenAddress, uint256 tokenAmount) public onlyValidToken(tokenAddress) {
        require(tokenAmount > 0, "Token amount required");

        InfluencerToken token = InfluencerToken(tokenAddress);
        require(token.balanceOf(msg.sender) >= tokenAmount, "Insufficient token balance");

        uint256 chzAmount = getChzAmountForToken(tokenAddress, tokenAmount);
        require(chzAmount > 0 && chzAmount <= tokenLiquidity[tokenAddress], "Invalid swap amount");

        token.transferFrom(msg.sender, address(this), tokenAmount);
        tokenLiquidity[tokenAddress] -= chzAmount;

        payable(msg.sender).transfer(chzAmount);

        emit TokenSwapped(msg.sender, tokenAddress, chzAmount, tokenAmount, false);
    }

    function getTokenAmountForChz(address tokenAddress, uint256 chzAmount) public view returns (uint256) {
        TokenInfo memory info = tokenInfo[tokenAddress];
        if (info.chzLiquidity == 0) return 0;

        return (chzAmount * info.totalSupply) / info.chzLiquidity;
    }

    function getChzAmountForToken(address tokenAddress, uint256 tokenAmount) public view returns (uint256) {
        TokenInfo memory info = tokenInfo[tokenAddress];
        if (info.totalSupply == 0) return 0;

        return (tokenAmount * tokenLiquidity[tokenAddress]) / info.totalSupply;
    }

    function getTokenInfo(address tokenAddress) public view returns (TokenInfo memory) {
        return tokenInfo[tokenAddress];
    }

    function getDeployedTokens() public view returns (address[] memory) {
        return deployedTokens;
    }

    function getTokenLiquidity(address tokenAddress) public view returns (uint256) {
        return tokenLiquidity[tokenAddress];
    }

    receive() external payable {}
}

